import React from 'react'

function Avatar (props) {
  return (
    <div>
      <img src={props.url} alt={props.name}/>
      <br/>
      <span>{props.name}</span>
    </div>
  )
}

function App () {
  return(
    <>
      <Avatar url="https://google.com.br/google" name="Ayrton"/>
    </>
  ) 
}

export default App
